import { ModelAnalyticsEvent } from './model-analytics-event';
export class CompareClickEvent extends ModelAnalyticsEvent {
    constructor(analyticsSetup, modelSeriesName, contentItem) {
        super(analyticsSetup, modelSeriesName);
        this.context.eventAction = 'PAGHomeNav_Compare_Click';
        this.populateComponentClickFromLink(contentItem);
    }
    populateComponentClickFromLink(contentItem) {
        this.componentClick.clickElementId = contentItem.PhraseId;
        this.componentClick.clickElementName = contentItem.Text;
        this.componentClick.clickElementType = 'link';
        this.componentClick.targetUrl = contentItem.Link;
    }
    event() {
        const componentClick = this.componentClick;
        return Object.assign(Object.assign({}, super.event()), { componentClick });
    }
}
